import React from 'react'
import Container from "@material-ui/core/Container"
import {makeStyles} from "@material-ui/core"
import {Link} from "react-router-dom"
// Source: https://www.freepik.com/free-vector/404-error-design-with-box_1534894.htm#page=1&query=sorry&position=1
import {ReactComponent as Image404} from '../assets/images/404.svg'
import ReactHlsPlayer from 'react-hls-player';
const useStyles = makeStyles(theme => ({
    container: {
        minHeight: "80vh",
        display: "flex",
        justifyContent: "center",
        flexDirection: "column",
        alignItems: "center"
    },
    title: {
        fontSize: '33pt',
        marginTop: 10
    },
    subtitle: {
        fontSize: '14pt'
    },
    action: {
        textDecoration: 'none',
        color: '#0037ff',
        margin: 6,
        "&:hover": {
            textDecoration: 'underline'
        }
    }
}))

function Page404(props) {
    const classes = useStyles()

    return (
        <Container className={classes.container}>
            <Image404 style={{height: 300}} />
            <div className={classes.title}>
            <ReactHlsPlayer
    src="https://bitdash-a.akamaihd.net/content/sintel/hls/playlist.m3u8"
    autoPlay={false}
    controls={true}
    width="100%"
    height="auto"
  >

  </ReactHlsPlayer>
                 </div>
            <div className={classes.subtitle}>
                Try searching or go to
                <Link className={classes.action} to="/">Home page.</Link>
            </div>
        </Container>
    )
}

export default Page404
